  false,\n\t\"url\": null,\n\t\"notes\": \"This report in on an investigation of duck
  nest success and small mammal abundance as it related to predation on Fish Springs
  National Wildlife Refuge (FSNWR)An investigation of nest success and the factors
  affecting it on FSNWR will not only provide important information to inform future
  management and create a comprehensive refuge management plan, but it will do so
  in a way that addresses the motivations behind the formation of the refuge: the
  protection and support of migratory birds. Our objective is to quantify duck production
  on the refuge and understand the factors that may be limiting nest survival, including
  understanding the interactions between small mammal populations and nest depredation.
  The information gained from the study will help guide management decisions for the
  refuge, as well as provide insight on factors affecting nest survival and nest site
  selection in unique habitats other than the Prairie Pothole Region.\",\n\t\"owner_org\":
